import React, { Component } from 'react'

export class NavaBar extends Component {
    render() {
        return (
            <nav className="navbar navbar-light bg-light">
                <a className="navbar-brand" href="#">Cart</a>
                
            </nav>
        )
    }
}

export default NavaBar
